import Header from '../../components/header';
import Head from '../../components/head';
import axios from 'axios'; 
import {useEffect} from 'react'

export async function getStaticProps() {
    
        // Call an external API endpoint to get posts.
    // You can use any data fetching library
    const res = await fetch('http://localhost:9000/profiles/')
    const posts = await res.json()

    // By returning { props: posts }, the Blog component
    // will receive `posts` as a prop at build time
    return {
        props: {
        posts,
        },
    }
}
export default ({posts})=>{
    const nom = posts.response.profiles[0].nom ; 
    const prenom = posts.response.profiles[0].prenom ; 
    const companyname = posts.response.profiles[0].companyname ; 
    const string = "Bonsoir "+nom+" "+prenom+", Votre societe"+companyname ;
    return(
        <div>
            <Header/>
            <Head/>
            {console.log(posts.response.profiles[0].nom)}
        </div>
    )
}
